import React from "react";
import AboutPic from "../../images/portfolio2min.png"
import "./about.css";

const About = () => {
  return (
    <div>
      <img
        src={AboutPic}
        alt="elizabeth regas"
        className="aboutPic"
      ></img>
      <p className="aboutText"></p>
    </div>
  );
};

export default About;
